
        let mapContainer = document.getElementById("map"),  //지도에 표시할 div
            mapOption = {
                center : new kakao.maps.LatLng(37.4787931,126.8807551), //지도 중심좌표
                level : 4 //지도 확대레벨 
            };
        
        let map = new kakao.maps.Map(mapContainer,mapOption);   //지도 생성

        // 마우스 휠로 지도 확대,축소 가능여부를 설정
        map.setZoomable(false) //true : 가능 , false : 불가능
        // 지도 확대 축소를 제어할 수 있는  줌 컨트롤을 생성합니다
        var zoomControl = new kakao.maps.ZoomControl();
        map.addControl(zoomControl, kakao.maps.ControlPosition.RIGHT);

        // HTML5의 geolocation으로 사용할 수 있는지 확인합니다 
        if (navigator.geolocation) {
            
            // GeoLocation을 이용해서 접속 위치를 얻어옵니다
            navigator.geolocation.getCurrentPosition(function(position) {
                
                var lat = position.coords.latitude, // 위도
                lon = position.coords.longitude; // 경도    
                console.log("위경도====",lat,lon)

                let imageSrc="/images/location/person2.png",
                    imageSize= new kakao.maps.Size(50, 50),  //마커이미지의 크기
                    imageOption ={offset: new kakao.maps.Point(27, 69)}   //마커이미지의 옵션 마커의 좌표와 일치시킬 이미지 안에서의 좌표를 설정

                    
                    
                    //마커의 이미지정보를 가지고 있는 마커이미지 생성
                    let markerImage= new kakao.maps.MarkerImage(imageSrc,imageSize,imageOption),
                        markerPosition = new kakao.maps.LatLng(lat, lon);
                // var locPosition = new kakao.maps.LatLng(lat, lon), // 마커가 표시될 위치를 geolocation으로 얻어온 좌표로 생성합니다
                //     message = '<div style="padding:5px;">현재위치</div>'; // 인포윈도우에 표시될 내용입니다
                
                // 마커와 인포윈도우를 표시합니다
                displayMarker(markerPosition, markerImage);
                    
            });
            
        } else { // HTML5의 GeoLocation을 사용할 수 없을때 마커 표시 위치와 인포윈도우 내용을 설정합니다
            
            var markerPosition = new kakao.maps.LatLng(33.450701, 126.570667),
             markerImage= new kakao.maps.MarkerImage(imageSrc,imageSize,imageOption)
                // message = 'geolocation을 사용할수 없어요..'
                
            displayMarker(markerPosition, markerImage);
        }

        // 지도에 마커와 인포윈도우를 표시하는 함수입니다
        function displayMarker(markerPosition, markerImage) {

            // 마커를 생성합니다
            var marker = new kakao.maps.Marker({  
                map: map, 
                position: markerPosition,
                image :markerImage
            }); 
            
            // var iwContent = message, // 인포윈도우에 표시할 내용
            //     iwRemoveable = true;

            // // 인포윈도우를 생성합니다
            // var infowindow = new kakao.maps.InfoWindow({
            //     content : iwContent,
            //     removable : iwRemoveable
            // });
            
            // // 인포윈도우를 마커위에 표시합니다 
            // infowindow.open(map, marker);
            
            // 지도 중심좌표를 접속위치로 변경합니다
            map.setCenter(markerPosition);      
        }    
        

       
        //마커를 표시할 위치와 샤싣 객체 배열

        //주소- 좌표 번환객채 생성
        let geocoder = new kakao.maps.services.Geocoder();
        //마커를 담을 배열
        let vc = [];
        //오버레이 담을 배열
        let ov =[];

        $.ajax({
            url : '/pharmacy',
            type : 'GET',
            traditional : true,
            success : function(data){
                // console.log(data)
                $.each(data, function(index,value){
                    //주소로 좌표를 검색합니다.
                    geocoder.addressSearch(data[index].agencyAddr,function(result,status){
                        //정상적으로 검색이 완료 됐으면
                        if(status === kakao.maps.services.Status.OK){
                            let coords = new kakao.maps.LatLng(result[0].y, result[0].x)
                            // console.log("coords ==", coords);

                            let imageSrc ='/images/location/pharmacy.png',
                                    imageSize = new kakao.maps.Size(40,42),
                                    imageOption = {offset: new kakao.maps.Point(20,42)}

                                let markerImage = new kakao.maps.MarkerImage(imageSrc,imageSize,imageOption);

                            //결과값으로 받은 위치를 마커로 표시합니다.
                            let marker = new kakao.maps.Marker({
                                map : map,
                                position : coords,
                                image : markerImage
                            });
                            
                            //커스텀 오버레이를 닫기 위해 호출되는 함수입니다.
                            function closeOverlay(){
                                overlay.setMap(null);
                            }
                            
                            const imageObject = [
                                {
                                    key : "이든약국",
                                    src : "data:image/png;base64,"
                                },
                                {
                                    key : "가디온누리약국",
                                    src :"data:image/jpeg;base64,"
                                },
                                {
                                    key : "중앙메디칼약국",
                                    src :"data:image/jpeg;base64,"
                                }
                            ]


                            const imgFind = imageObject.find(function(param){
                                return param.key === data[index].agencyName
                            })

                            const noImg = "data:image/png;base64," 

                            
                            //커스텀 오버레이에 표시할 컨텐츠 입니다.
                            let wrap = $('<div class="wrap" />');
                            let info = $('<div class="info" />');
                            let title = $('<div class="title" />').text(data[index].agencyName);
                            let close = $('<div class="close" title="닫기" />').click(closeOverlay);
                            let body = $('<div class="body" />');
                            let img = $('<div class="img" />');
                            let imgtag = $(`<img src= ${!!imgFind ? imgFind.src :noImg} width="80" height="70">`);
                            let desc = $('<div class="desc"/>');
                            let ellipsis = $('<div class="ellipsis"/>').text(data[index].agencyAddr);
                            let tel = $('<div class="tel"/>').text(data[index].agencyTel);
                            let times =$('<div class="time d-flex justify-content-center"/>')
                            let time1 =$('<div class="time1 me-4"/>')
                            let time2 =$('<div class="time2"/>')
                            let weekday =$('<div/>').text('평일 : '+data[index].agencyWorkHourVO.mon)
                            let sat =$('<div style="color:blue"/>').text('토요일 : '+data[index].agencyWorkHourVO.sat);
                            let sun =$('<div style="color:red"/>').text('일요일 : '+data[index].agencyWorkHourVO.sun);
                            // let holiday =$('<div style="color:red"/>').text('공휴일 : '+data[index].agencyWorkHourVO.holiday);
                            let lunch =$('<div style="text-align:center"/>').text('점심시간 : '+data[index].agencyWorkHourVO.lunch);
                            // let reservation = $('<button class="btn btn-outline-secondary reservation" type="button" onclick="notifyMe()" />').text(' 직접수령 ')

                            wrap.append(info);
                            info.append(title).append(body);
                            title.append(close);
                            body.append(img);
                            img.append(imgtag);
                            body.append(desc);
                            desc.append(ellipsis);
                            desc.append(tel);
                            body.append(times);
                            times.append(time1);
                            time1.append(weekday);   //월요일
                            time1.append(lunch);    //점심시간
                            times.append(time2);
                            time2.append(sat);       //토요일
                            time2.append(sun);   //일요일
                          
                            // desc.append(reservation);
                            
                            let content = wrap[0];

                            //마커 위에 커스텀오버레이를 표시합니다.
                            //마커를 중심으로 커스텀 오버레이를 표시학 위해 css이용해 위치 설정
                            let overlay = new kakao.maps.CustomOverlay({
                                content : content,
                                map : map,
                                position : marker.getPosition()
                            });

                            ov.push(overlay);
                            //마커를 클릭했을 때 커스텀 오버레이를 표시합니다.
                            kakao.maps.event.addListener(marker, 'click' ,function(){

                                for(let i=0; i<ov.length; i++){
                                    ov[i].setMap(null);
                                }
                                overlay.setMap(map);
                            });

                            closeOverlay();

                            marker.setMap(map)
                        }//if문
                    })
                })
            },
            error : function(xhr,status,error){
                console.log("xhr : ",xhr)
                console.log("status : ", status)

            }
        });